import React from 'react';

const Chart = () => {
  return (
      <>
      <div className='containerleft'>
      <p className='skillhead'>Comparison between different Skills</p>
      <img className='skills' src="https://eww-wp-new.s3.ap-south-1.amazonaws.com/wp-content/uploads/2020/12/18113322/popular-programming-languages.png"/>
      </div>
      </>
  );
};

export default Chart;
